import React, { Component } from 'react';
import Navbar from '../components/Navbar';

class TripFavs extends Component {
  render() {
    return (
      <div>
        <h1>TripFavs</h1>
        <Navbar />
      </div>
    );
  }
}

export default TripFavs;
